(245, '194', '2020-07-22 18:01:44', 'От клиента добавление: По G194 добавление. С Kugoo M4 есть ещё проблема, менее \\"жгучая\\", которая в принципе была временно терпима до починки контроллера на Kugoo S2 (чтоб не остаться без колёс совсем).\\r\\n\\r\\nОна, скорее всего, связана, как сказал ещё до поломки Kugoo M4 Евгений, с разбалансировкой батареи. Симптомы: снизился пробег с 24 км до 15 км (самокат куплен год назад, вполне вероятно) и замечается падение отображаемого назначения напряжения при \\"газе\\" с места на самой высокой \\"скорости\\" на две \\"палки\\" (из пяти). Правда, незадолго перед этим я заменил продырявившуюся камеру, мог в процессе этого немного по-\\"мочалить\\" и поизгибать провод, идущий к двигателю, что, как представляется мне, могло вызвать рост его сопротивления и катастрофическое снижения срока службы.', 'Станислав Засыпкин', 6, 1, 1),
