(1113, '576', '2020-09-21 16:51:23', 'выдан без ремонта, клиент устал ждать', 'Засыпкин Станислав', 6, 1, 1),
(1114, '622', '2020-09-21 17:29:44', 'покрышка согласована', 'Засыпкин Станислав', 6, 1, 1),
(1115, '477', '2020-09-22 08:21:54', 'запчасти поступили можно брать в работу<br>все по гарантии замена калипера, курка газа замена камеры (камера на руле, запчасти в коробке)', 'Шулик Евгений', 12, 6, 2),
(1116, '592', '2020-09-22 08:23:36', 'мотор приехал, можно брать в работу', 'Шулик Евгений', 12, 6, 2),
(1117, '623', '2020-09-22 10:29:52', 'Заменил заднюю камеру', 'Алексей', 22, 1, 1),
(1118, '477', '2020-09-22 12:46:13', 'Заменил:<br>1) камеру<br>2) калипер тормозной + настройка тормоза<br>3) ручку газа <br><br>Причина поломки тормоза:<br>Был не затянут прижимной винт тормозной колодки, от чего тормозная колодка ходила по посадочному месту.', 'Алексей', 22, 1, 1),
(1119, '585', '2020-09-22 13:05:10', 'если заказ выдан - выдай в лоджике', 'Засыпкин Станислав', 6, 12, 1),
(1120, '616', '2020-09-22 16:35:18', '1)перекинул заднюю покрышку на переднее колесо<br>2)поставил нашу камеру 8х2 на переднее колесо<br>3)поставил литую покрышку на заднее колесо', 'Алексей', 22, 1, 1),
(1121, '595', '2020-09-22 16:57:11', 'Снял обе покрышки с камерами<br><br>Жду когда будут литые покрышки', 'Алексей', 22, 1, 1),
(1122, '300', '2020-09-22 17:07:54', 'сервис перегружен, пока убираю предзаказ в архив', 'Засыпкин Станислав', 6, 1, 1),
(1123, '301', '2020-09-22 17:09:39', 'пока сервис перегружен, убираю в архив. Можно позвонить и пригласить в голодный год', 'Засыпкин Станислав', 6, 1, 1),
(1124, '477', '2020-09-22 17:38:21', 'самокат у клиента! заказываем тормозную ручку, звонок. Когда всё придет - вызываем клиента и быстро меняем', 'Засыпкин Станислав', 6, 1, 1),
(1125, '505', '2020-09-22 18:14:11', 'Собрал корпус <br>Вкрутил 12 саморезов + 6 болтов', 'Алексей', 22, 1, 1),
(1126, '530', '2020-09-23 11:02:42', 'Настроил задний тормоз<br>Подтянул рулевую(люфтила)<br>Перебрал и смазал заднюю подвеску<br>', 'Алексей', 22, 1, 1),
(1127, '600', '2020-09-23 11:22:37', 'Отвалилась перемычка, восстановлен, работает', 'Макаров Валерий', 17, 12, 1),
(1128, '621', '2020-09-23 11:25:39', 'Как следует прогорел текстолит в районе стабилизатора питания, восстановим', 'Макаров Валерий', 17, 12, 1),
(1129, '621', '2020-09-23 12:03:24', 'Замена стабилизатора напряжения XL7015, конденсатора 100V 33uF, диода SS110 чистка платы, восстановление силовых и сигнальных дорожек. Работает. 3500', 'Макаров Валерий', 17, 1, 1),
(1130, '617', '2020-09-23 12:17:52', 'ОБЯЗАТЕЛЬНО согласовать гарантию с халтен и о результатах сообщить покупателю ', 'Шулик Евгений', 12, 1, 1),
(1131, '478', '2020-09-23 13:00:07', 'Заменил стабы, работает<br>TPS54260<br>TPS563200<br>Конденсатор 63V 1000uF', 'Макаров Валерий', 17, 12, 1),
(1132, '592', '2020-09-23 17:14:09', 'Вскрыл корпус, очистил от старого герметика, поменял мотор, поставил на заднее колесо нашу камеру 10х2.5, загерметизировал, настроил задний тормоз, подтянул заднюю подвеску ', 'Алексей', 22, 1, 1),
(1133, '567', '2020-09-23 18:52:52', 'самокат отдал на время, но из очереди не удалять, привезет как подойдет время ', 'Шулик Евгений', 12, 6, 2),
(1134, '567', '2020-09-23 18:52:52', 'самокат отдал на время, но из очереди не удалять, привезет как подойдет время ', 'Шулик Евгений', 12, 6, 2),
(1135, '478', '2020-09-23 19:04:55', 'Сдох', 'Макаров Валерий', 17, 1, 1),
(1136, '629', '2020-09-23 19:05:23', 'Отвалился провод от разъема батареи в блоке батареи, запаян, работает', 'Макаров Валерий', 17, 12, 1),
(1137, '592', '2020-09-23 20:08:27', 'работы в ls', 'Шулик Евгений', 12, 1, 1),
(1138, '595', '2020-09-23 21:02:51', 'Поставил литые покрышки', 'Алексей', 22, 1, 1),
(1139, '630', '2020-09-24 17:01:29', 'Батка в ноль посажена', 'Макаров Валерий', 17, 1, 1),
(1140, '453', '2020-09-24 19:47:19', 'Установлена новая ось, настроены тормоза, выправлены диски, восстановлена аквазащита.<br>Большая идеологическая победа.', 'Макаров Валерий', 17, 1, 1),
(1141, '561', '2020-09-25 14:18:10', '1 верхний отвал, есть смысл пропаять всю гибкими проводами', 'Макаров Валерий', 17, 6, 2),
